import Head from '../Head';
import Body from './Body';
import Footer from './Footer';

const Layout = ({ children, title, description, url, image }) => (
	<>
		<Head title={title} description={description} url={url} ogImage={image} />
		<Body {...children} />
		<Footer />
	</>
);

export default Layout;
